import React from "react";
import styled from "styled-components";

const BlogPostItem = (props) => {
  return (
    <>
      <div>
        <h1>{props.MainTitlePost}</h1>
        <img src={props.Cover} />
        {props.content}
      </div>
    </>
  );
};

export default BlogPostItem;
